import React, { Fragment } from 'react';

const Login = () => {

  return (
    <Fragment>
        <form>
            <input type="email" name="email" placeholder="email"></input>
            <input type="password" name="password" placeholder="password"></input>
            <button>Submit</button>
        </form>
    </Fragment>
  );
}

export default Login;
